import React from "react";
import { Link } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faSearch, faPlus, faList, faUser } from "@fortawesome/free-solid-svg-icons";
import { faHeart } from "@fortawesome/free-regular-svg-icons";

import logo from "assets/images/logo.svg";

const SearchInput = () => {
  return (
    <div className="search-input">
      <FontAwesomeIcon icon={faSearch} />
      <input type="text" placeholder="Search" />
    </div>
  );
};

const Nav = () => {
  return (
    <nav className="nav">
      <div className="nav__logo">
        <img src={logo} alt="Flavorology" />
      </div>
      <div className="nav__menu">
        <Link to="/recepten">Recepten</Link>
        <Link to="/onlangs-toegevoegd">Onlangs toegevoegd</Link>
        <Link to="/uitproberen">Uitproberen</Link>
        <SearchInput />
      </div>
      <div className="nav__icons">
        <div className="icon add"><FontAwesomeIcon icon={faPlus} /></div>
        <div className="icon list"><FontAwesomeIcon icon={faList} /></div>
        <div className="icon favorites"><FontAwesomeIcon icon={faHeart} /></div>
        <div className="icon user"><FontAwesomeIcon icon={faUser} /></div>
      </div>
    </nav>
  );
};

export default Nav;
